description:
Ce jeu de données contient les périmètres de délimitation aux différents stades de l'élaboration du PPRN. Ces périmètres ont comme caractéristique d'être la conséquence d'un acte officiel et de produire leurs effets à compter d'une date définie. Il s'agit du :
- périmètre prescrit figurant dans l'arrêté de prescription d'un PPR (naturel ou technologique) ;
- périmètre d'exposition aux risques qui correspond au périmètre réglementé par le PPR approuvé. Ce périmètre approuvé vaut servitude d'utilité publique (PM1 pour les PPRN et PM3 pour les PPRT) ;
- périmètre d'étude qui correspond à l'enveloppe dans laquelle ont été étudiés les aléas.

Conformément à la loi n° 92-1444 du 31 décembre 1992 relative à la lutte contre le bruit ainsi qu’au Code de l’environnement (articles L. 571-10 et R. 571-32 à R. 571-43), dans chaque département, le préfet recense et classe les infrastructures de transports terrestres en fonction de leurs caractéristiques sonores et du trafic. Sur la base de ce classement, il détermine, après consultation des communes, les secteurs affectés par le bruit, les niveaux de nuisances sonores à prendre en compte pour la construction de bâtiments et les prescriptions techniques de nature à les réduire.
Les secteurs ainsi déterminés et les prescriptions relatives aux caractéristiques acoustiques qui s’y appliquent sont reportés dans les annexes des plans locaux d’urbanisme (PLU) des communes concernées.
L’article R. 571-33 du Code de l’environnement, précise les infrastructures concernées par le classement sonore :
- les voies routières dont le trafic journalier moyen annuel existant, ou prévu dans l’étude ou la notice d’impact, est supérieur à 5000 véhicules par jours;
- les lignes ferroviaires interurbaines assurant un trafic journalier moyen supérieur à 50 trains ;
- les lignes en site propre de transports en commun dont le trafic journalier moyen est supérieur à 100 autobus ;
- les lignes ferroviaires urbaines dont le trafic journalier moyen est supérieur à 100 trains.
La carte de classement sonore et les arrêtés préfectoraux sont consultables sur le site internet des services de l’État en département.
Seuls les documents annexés aux arrêtés préfectoraux font foi.
