Un centre d’examen du permis de conduire peut désigner indifféremment :
- des locaux administratifs (bureau du délégué) ;
- des salles utilisées pour l’Épreuve théorique générale (ETG) ;
- des pistes utilisées pour l’examen pratique (moto, poids-lourds) ;
- un secteur correspondant à un circuit pour l’examen pratique.
Les centres d’examen des permis de conduire sont principalement caractérisés par leur localisation géographique, leur nature (pratique, théorique, administratif) et leur qualification (examen théorique, permis A, permis B, permis EC).
L’intérêt du présent standard est de permettre aux directions départementales des territoires de cartographier les centres d’examen des permis de conduire afin d’informer le public de leur localisation.

Représentation du réseau routier de la Haute-Savoie et données de trafic.
Réalisée à partir de la table « N_ROUTE_BDC_074 » de la BD CARTO, des données de trafic fournies par les gestionnaires de réseaux routiers et les cartes de comptages réalisées annuellement par la DDT et le CD74.
Trois étapes ont été nécessaires :
• sélection et fusion des tronçons de route du réseau routier structurant, ainsi que des tronçons du réseau non-structurant possédant une station de comptage permanente ou temporaire ;
• numérotation des tronçons et indication du type de comptage (pour éviter les renumérotations annuelles des comptages sur les routes départementales) ;
• saisie des données de trafic disponibles pour chacun de ces tronçons en 1998 et chaque année à partir de 2007.

